import React from "react";

const NavBar = () => {
	return (
		<nav className="nav-bar">
			<div className="nav-content">
				<div className="logo">
					<a href="#">My Logo</a>
				</div>
				<div className="nav-links">

				</div>
			</div>
		</nav>
	)
}

export default NavBar;
